import React from "react";

import { Heading } from "./styles";
import { useParams } from "react-router-dom";

const PersonBio = () => {
  const { id }: any = useParams();
  return (
    <div>
      <Heading>PersonBio {id}</Heading>
      <div className="container">
        <h2>Name:</h2>
      </div>
    </div>
  );
};

export default PersonBio;
